			runOnlyForDeploymentPostprocessing = 0;
			shellPath = /bin/sh;
			shellScript = "# Make sure that the Frameworks path exists\nmkdir -p $BUILT_PRODUCTS_DIR/$FRAMEWORKS_FOLDER_PATH\n\ntrim()\n{\n  trimmed=$1\n  trimmed=${trimmed%% }\n  trimmed=${trimmed## }\n  echo $trimmed\n}\n\ncopy_framework()\n{\n  path=$1\n  echo \"Trying to copy framework from $path\"\n\n  if [ -f \"$path\" ]; then\n    echo \"Copying '$path' to '$BUILT_PRODUCTS_DIR/$FRAMEWORKS_FOLDER_PATH/'\"\n    cp \"$path\" \"$BUILT_PRODUCTS_DIR/$FRAMEWORKS_FOLDER_PATH/\"\n\n    # Make sure we change the install name to be relative to the loader path\n    file_name=`basename $path`\n    file_path=\"$BUILT_PRODUCTS_DIR/$FRAMEWORKS_FOLDER_PATH/$file_name\"\n    install_name=\"@loader_path/Frameworks/$file_name\"\n    \n    echo \"Changing the id of '$file_name' to '$install_name'\"\n    install_name_tool -id \"$install_name\" \"$file_path\"\n    \n    echo \"Changing '$path' to '$install_name'\"\n    install_name_tool -change \"$path\" \"$install_name\" \"$BUILT_PRODUCTS_DIR/$EXECUTABLE_PATH\"\n\n    return 1\n  fi\n  echo \"ERROR: Unable to find $path.\"\n  return 0\n}\n\n# Check to see if the path specified by the executable is the framework\nexec_path=\"$(trim `otool -L \"$BUILT_PRODUCTS_DIR/$EXECUTABLE_PATH\" | grep -E libyaml.+\\.dylib | sed 's/^[ ]//' | sed 's/ (compatibility.*//'`)\"\nif [ \"`echo \"$exec_path\" | grep '^@loader_path/Frameworks/libyaml'`\" != \"\" ]; then\n  file_name=`basename $exec_path`\n  if [ -f \"$BUILT_PRODUCTS_DIR/$FRAMEWORKS_FOLDER_PATH/$file_name\" ]; then\n    echo \"Library is already installed.\"\n    exit 0\n  fi\nelif [ -f \"$exec_path\" ]; then\n  copy_framework \"$exec_path\"\n  if [ $? == 1 ]; then\n    exit 0\n  fi\nfi\n\n# Copy over the framework\necho \"Looking for framework to copy...\"\nfor path in $LIBRARY_SEARCH_PATHS; do\n  path=`echo \"$path\" | sed 's/\\/ *$//'`\n  copy_framework \"$path/libyaml.dylib\"\n  exit 0\ndone\n\necho \"Error: Unable to find 'libyaml.dylib' in library search path ($LIBRARY_SEARCH_PATHS).\"\nexit 1\n";
			showEnvVarsInLog = 0;
		};
